import './App.css';
import { Header } from './components/header';
import { Footer } from './components/footer';
import { Home } from './modules/Home';
import { Route } from 'react-router-dom';
function App() {
  return (
    <div>
      <Header />
      <Router>
        <Route path="/" element={<Home />} />
      </Router>
      <Footer />
    </div>
  );
}

export default App;
